  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112242 includes chemical,
  discrete sample, physical and profile data collected from Hokusei Maru in the North
  Pacific Ocean from 1999-07-19 to 1999-08-19 and retrieved during cruise 49HO19990719
  and HO99-3. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION),
  NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD, Coulometer for DIC measurement and bottle.
  These data were collected by Shuichi Watanabe of Hokkaido University as part of
  the PACIFICA_49HO19990719 data set.nnPACIFICA (PACIFic ocean Interior CArbon) was
  an international collaborative project for the data synthesis of ocean interior
  carbon and its related parameters in the Pacific Ocean. The North Pacific Marine
  Science Organization (PICES), Section of Carbon and Climate (S-CC) supported the
  project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
